import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from 'react-router-dom';

import PlayerViewer from './PlayerViewer';
import PlayerSelector from './PlayerSelector';

function App() {
  return (
    <Router>
      <div>
        <ul>
          <li><Link to='/'>Home</Link></li>
          <li><Link to='/p/:playerAbbr'>Player Dashboard</Link></li>
        </ul>
        <hr />
        <Switch>
          <Route exact path='/'>
            <PlayerSelector />
          </Route>
          <Route path='/p/:playerAbbr'><PlayerViewerRoute /></Route>
        </Switch>
      </div>
    </Router>
  );
}

function PlayerViewerRoute() {
  let { playerAbbr } = useParams();
  return (<PlayerViewer playerAbbr={playerAbbr} />);
}



export default App;
